    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Modoc NWR for the next 15 years. This plan outlines
    the Refuge vision and purpose and describes how Modoc NWR will contribute to the
    overall mission of the Refuge System. The plan provides an introduction to the Refuge,
    an overview of the CCP process, information about the environment, current management
    programs, and strategies for implementation. Key planning issues include: wildlife
    management, water rights, habitat management, public use, and threatened and endangered
